import "./WeekItem.css"

const WeekItem = () => {
    return (
        <div className="week-item">
            <b className="search-engine">1</b>
            <div className="generator-wrapper">
                <div className="generator" />
            </div>
        </div>
    );
}

export default WeekItem;
